  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).
  The Biodiversity Conservation category in this web service includes layers illustrating
  the ecosystems and natural resources that support biodiversity, the need or demand
  for conservation, the impacts associated with biodiversity and conservation, and
  factors that place stress on the natural environment's capability to maintain biodiversity.
  EnviroAtlas allows the user to interact with a web-based, easy-to-use, mapping application
  to view and analyze multiple ecosystem services for the conterminous United States.
  Additional descriptive information about each attribute in this web service is located
  within each web service layer (see Full Metadata hyperlink) or can be found in its
  associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
